webpackJsonp([0xb627ae6203ee],{359:function(a,t){a.exports={data:{markdownRemark:{html:'<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/map-main-89206b8dbc3d28e8617fc56a5be708a8-0b051.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.69527896995709%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="map main"\n        title=""\n        src="/static/map-main-89206b8dbc3d28e8617fc56a5be708a8-fb8a0.png"\n        srcset="/static/map-main-89206b8dbc3d28e8617fc56a5be708a8-1a291.png 148w,\n/static/map-main-89206b8dbc3d28e8617fc56a5be708a8-2bc4a.png 295w,\n/static/map-main-89206b8dbc3d28e8617fc56a5be708a8-fb8a0.png 590w,\n/static/map-main-89206b8dbc3d28e8617fc56a5be708a8-526de.png 885w,\n/static/map-main-89206b8dbc3d28e8617fc56a5be708a8-0b051.png 1165w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>During an REU (Research Experiences for Undergraduates) in 2014 I was part of an effort between my Undergrad university (Southern Connecticut State University) and a group at Yale to characterize large compositional libraries of metallic glasses. Theses libraries where created using magnetron sputtering using a thin film silicon wafer as the target. Depending on if a mask was used, each wafter could contain ~300 unique compositions or a continuous composition gradient if the mask was absent.</p>\n<p>At my university we where tasked with determining the composition at each point on a wafer. Composition for each point on the wafer was determined using energy dispersive X-ray spectroscopy (EDS). In it\'s initial state characterization data was shared between groups in a dropbox folder. I realized that this method of data storage was inefficient for a number of reasons. First, multiple types of characterization was done for each data point. Not only was the composition determined, but a number of other properties where also considered, such surface imagining. Furthermore, this data was meant to be post-processed to create a number of visualizations such as the composition gradient across the wafer and a ternary diagram. Due to the data being stored in multiple formats and files, this process was laborious. </p>\n<p>Observing such shortcomings, I decided to create a web application that will allow both groups to upload characterization information for each wafer. This app visualized each wafers composition as a RGB plot and composition gradient as well as a ternary plot. Such plots where interactive allowing users the option to view any images associated with a particular point.</p>\n<h2>Visualization Types</h2>\n<h3>RGB Plots</h3>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/rgb-plot-24a931cf9f38042913b11ffdc411a49d-f9285.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 53.80997177798683%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="rgb plot"\n        title=""\n        src="/static/rgb-plot-24a931cf9f38042913b11ffdc411a49d-fb8a0.png"\n        srcset="/static/rgb-plot-24a931cf9f38042913b11ffdc411a49d-1a291.png 148w,\n/static/rgb-plot-24a931cf9f38042913b11ffdc411a49d-2bc4a.png 295w,\n/static/rgb-plot-24a931cf9f38042913b11ffdc411a49d-fb8a0.png 590w,\n/static/rgb-plot-24a931cf9f38042913b11ffdc411a49d-526de.png 885w,\n/static/rgb-plot-24a931cf9f38042913b11ffdc411a49d-f9285.png 1063w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>3D Composition Maps</h3>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/3d-plot-3528d2077a96e78948ab4433f36f2429-99c89.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 59.210526315789465%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="3d plot"\n        title=""\n        src="/static/3d-plot-3528d2077a96e78948ab4433f36f2429-fb8a0.png"\n        srcset="/static/3d-plot-3528d2077a96e78948ab4433f36f2429-1a291.png 148w,\n/static/3d-plot-3528d2077a96e78948ab4433f36f2429-2bc4a.png 295w,\n/static/3d-plot-3528d2077a96e78948ab4433f36f2429-fb8a0.png 590w,\n/static/3d-plot-3528d2077a96e78948ab4433f36f2429-526de.png 885w,\n/static/3d-plot-3528d2077a96e78948ab4433f36f2429-99c89.png 1064w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Contour Plots</h3>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/contour-plots-ceae6cb567599736f1b892304bd9e9e1-f49f8.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 51.95989061075661%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="contour plots"\n        title=""\n        src="/static/contour-plots-ceae6cb567599736f1b892304bd9e9e1-fb8a0.png"\n        srcset="/static/contour-plots-ceae6cb567599736f1b892304bd9e9e1-1a291.png 148w,\n/static/contour-plots-ceae6cb567599736f1b892304bd9e9e1-2bc4a.png 295w,\n/static/contour-plots-ceae6cb567599736f1b892304bd9e9e1-fb8a0.png 590w,\n/static/contour-plots-ceae6cb567599736f1b892304bd9e9e1-526de.png 885w,\n/static/contour-plots-ceae6cb567599736f1b892304bd9e9e1-f49f8.png 1097w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Ternary Plots</h3>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/ternary-plots-68c0f5b3692cd11d3f6aafeab3a5ff3a-f171e.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 44.93670886075949%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="ternary plots"\n        title=""\n        src="/static/ternary-plots-68c0f5b3692cd11d3f6aafeab3a5ff3a-fb8a0.png"\n        srcset="/static/ternary-plots-68c0f5b3692cd11d3f6aafeab3a5ff3a-1a291.png 148w,\n/static/ternary-plots-68c0f5b3692cd11d3f6aafeab3a5ff3a-2bc4a.png 295w,\n/static/ternary-plots-68c0f5b3692cd11d3f6aafeab3a5ff3a-fb8a0.png 590w,\n/static/ternary-plots-68c0f5b3692cd11d3f6aafeab3a5ff3a-526de.png 885w,\n/static/ternary-plots-68c0f5b3692cd11d3f6aafeab3a5ff3a-f171e.png 1106w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>The app was built using Django. It contained models for the wafers and their data points. Wafers where associated with users, where the uploader had the option to set a wafer to private and public. Users of the app could view all the public wafers and manage the data of their wafers. This included the option to add and edit points and upload entire data sets in bulk. On the front end visualizations where all handled done using D3.js. </p>\n<p>This project was my first introduction to web development and my first real coding project. If it wasn\'t for this project I would of never realized the passion and talent I have for web dev and software development as a whole. Therefore I am happy to know that this this project is still being maintained and used by the Yale group. While it appears the newer app has since been rewritten in Meteor, it is comforting to see it still retains and iterates on my original vision.</p>',frontmatter:{date:"June 25, 2018",path:"/materails-atlas-project",title:"Materials Atlas Project",image:{childImageSharp:{sizes:{base64:"data:image/png;base64,",aspectRatio:.9518072289156626,src:"/static/map-32def0abea873d7af13f826e4999eeeb-8424e.png",srcSet:"/static/map-32def0abea873d7af13f826e4999eeeb-afc4d.png 158w,\n/static/map-32def0abea873d7af13f826e4999eeeb-ccefd.png 315w,\n/static/map-32def0abea873d7af13f826e4999eeeb-8424e.png 474w",sizes:"(max-width: 474px) 100vw, 474px"}}}}}},pathContext:{}}}});
